        "Desc": "해당 상태에서 포효의 영구(靈柩)의 속도가 증가하고, [합성 늑대 독]과 [살육 알고리즘]을 발동할 수 있다. 포효의 영구가 약점 격파될 시 해당 상태는 해제된다"
