        "Desc": "해당 상태에서 호뢰는 속도가 증가하고 추가 스킬을 발동한다. 호뢰가 필드에 있으면 [검은 발톱 늑대 병사]와 [식월 늑대 병사]의 달의 광기 효과가 강화되며, 호뢰의 약점이 격파되면 해당 상태는 해제된다"
